import Price from "./PriceSP";
import NAME from "./NameSP";
import IMG from "./ImageSP";
function LoaiSP(truyen){
    return(
        
        <>
        <div class="headerLoai">
            <div class="row">
            <div class="col-sm-4"><p>LOAI SAN PHAM</p></div>
            <div class="col-sm-4"></div>
            <div class="col-sm-4"><a href="">Xem tat ca</a></div>
        </div>
   </div>
   
        <div class="col-sm-3">
            <IMG url={truyen.member.IMG} />
        </div>
        
   
        </>
    );
}
export default LoaiSP;
